    console.log(text)
  }

  console.log({ username })
  return (
    <View>
      <TextInput 
        style={styles.input}
        placeholder='Username'
        onChangeText={onChangeText}
        value={username}
      />
      <TextInput 
        style={styles.input}
        placeholder='Password'
        onChangeText={onChangeText}
        value={password}
      />
      <Button
        title='Login'
      />
    </View>
  )
}

